package compress

import (
	"testing"
	"bytes"
	"github.com/wanchain/go-wanchain/common"
	"fmt"
)
func TestCompress(t *testing.T) {
	hexData := ""
	data := common.FromHex(hexData)
	cd,err := Compress(data)

	if err != nil {
		t.Fail()
	}

	fmt.Println(common.ToHex(cd))

	ucd,err := Uncompress(cd)
	if err != nil {
		t.Fail()
	}

	if !bytes.Equal(data,ucd) {
		t.Fail()
	}
}


